'',
'var run = 1;',
'',
'var dispImage = function (time,name, ctx, c) {',
'setTimeout( function() {',
'    ctx.clearRect(0, 0, c.width, c.height);',
'    img=document.getElementsByClassName("animation-frame " + name)[document.getElementsByClassName("animation-frame " + name).length-1];',
'    ctx.drawImage(img,0,0);},time);',
'}',
'',
'var getFrameCount = function() {',
'    return document.getElementsByClassName("animation-frame")[document.getElementsByClassName("animation-frame").length-1].getAttribute(''frameno'');',
'}',
'',
'frameInterval = 0;',
'var showImages = function myself() {',
'    var c=document.getElementsByClassName("animation-canvas")[document.getElementsByClassName("animation-canvas").length-1];',
'    var ctx=c.getContext("2d");',
'    var framecount = getFrameCount();',
'    var intervalLength = framecount*200;',
'    clearInterval(frameInterval);',
'    setTimeout( function() {',
'             var i = 1;',
'             for(i = 1; i <= framecount; i++) {',
'                 dispImage(200*i, ''frame-no'' + i , ctx, c);',
'             }',
'          myself();',
'        }, intervalLength );',
'};',
'if (run === 1) {',
'   showImages();',
'    run = 0;',
'}',
'</script>'))
